{
    "class": "ADC",
    "schemaVersion": "3.22.0",
    "label": "Sample 1",
    "remark": "Simple HTTP Service with Round-Robin Load Balancing",
    "demo_tenant": {
        "class": "Tenant",
        "nginx_test_app": {
            "class": "Application",
            "nginx_test_app": {
                "class": "Service_HTTP",
                "virtualAddresses": [
                    "10.0.2.238"
                ],
                "persistenceMethods": [],
                "profileMultiplex": {
                    "bigip": "/Common/oneconnect"
                },
                "pool": "web_pool"
            },
            "web_pool": {
                "class": "Pool",
                "monitors": [
                    "http"
                ],
                "members": [
                    {
                        "servicePort": 80,
                        "addressDiscovery": "aws",
                        "updateInterval": 1,
                        "tagKey": "Name",
                        "tagValue": "nan-autows101-tf-nginx-autoscale",
                        "addressRealm": "private",
                        "region": "eu-west-2"
                    }
                ]
            }
        }
    }
}
